export function weightedUniformStrings(s, queries) {
    const charCount = s.split("")
        .reduce(
            (counts, char) => {
                counts[char.charCodeAt(0) - 96]++;
                return counts;
            },
            Array(27).fill(0)
        );

    return queries.map((query) => charCount.some((count, weight) => ((query % weight) === 0) && ((query / weight) <= count)));
}

